comment.body:
@mikebski the Kotlin where DSL has been completely rewritten since 1.2.1 - hopefully you will like it better!

This doc page explains how to use the updated Kotlin DSL, and how to migrate from prior releases: https://mybatis.org/mybatis-dynamic-sql/docs/kotlinWhereClauses.html

Specifically, for your example, the new form is like this:

```kotlin
val selectStatement = mapper.select {
  where {
    description isLike "%${desc}%"
    or { notes isLike "%${desc}%" }
  }
}
```

